  "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
  "version": "1.4",
  "type": "AdaptiveCard",
  "background": {
    "color": "#FFC107"
  },
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello, world!"
    }
  ]
}
```

In this example, the background color of the adaptive card is set to `#FFC107`, which is a shade of orange.

If you want to change the background color dynamically, you can use a template string in the `background` property and replace it with a variable value. For example:

```json
{
  "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
  "version": "1.4",
  "type": "AdaptiveCard",
  "background": {
    "color": "${backgroundColor}"
  },
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello, world!"
    }
  ]
}
```

Then, you can replace the `backgroundColor` variable with a value when rendering the card. For example, in JavaScript:

```javascript
const card = {
  // ... card schema ...
};

const backgroundColor = "#FFC107";
const renderedCard = card.background.color.replace("${backgroundColor}", backgroundColor);
```

Note that the `background` property can also be used to set other background styles, such as an image or a gradient. For more information, see the [Adaptive Cards documentation](https://adaptivecards.io/explorer/Background.html).

